dfds','abc',312,'23ab2ee2-6e58-4c70-9b63-d84cb254fab8_profile_500.png',1),(182,'ㅋㅌㅊㅍ','ㅁㄴㅇㄹㅋㅌㅊㅍ','ㅋㅌㅊㅍ',406,'87c55267-c43c-49ff-9fbe-de8782005f83_source_03.jpg',0),(183,'공공필요에 의한 재산','대통령은 국가의 원수이며, 외국에 대하여 국가를 대표한다. 국민의 모든 자유와 권리는 국가안전보장·질서유지 또는 공공복리를 위하여 필요한 경우에 한하여 법률로써 제한할 수 있으며, 제한하는 경우에도 자유와 권리의 본질적인 내용을 침해할 수 없다.','ㅋㅌㅊㅍ',309,NULL,0),(184,'누구든지 체포','국회는 헌법개정안이 공고된 날로부터 60일 이내에 의결하여야 하며, 국회의 의결은 재적의원 3분의 2 이상의 찬성을 얻어야 한다. 대통령이 궐위되거나 사고로 인하여 직무를 수행할 수 없을 때에는 국무총리, 법률이 정한 국무위원의 순서로 그 권한을 대행한다.','ㅋㅌㅊㅍ',224,NULL,1),(185,'대한민국의 경제질서','모든 국민은 자기의 행위가 아닌 친족의 행위로 인하여 불이익한 처우를 받지 아니한다. 국민경제의 발전을 위한 중요정책의 수립에 관하여 대통령의 자문에 응하기 위하여 국민경제자문회의를 둘 수 있다.','ㅋㅌㅊㅍ',215,NULL,0),(186,'dsfsd','sdgdsfs','ㅋㅌㅊㅍ',405,NULL,0),(187,'각급 선거관리위원회','누구든지 체포 또는 구속을 당한 때에는 적부의 심사를 법원에 청구할 권리를 가진다. 통신·방송의 시설기준과 신문의 기능을 보장하기 위하여 필요한 사항은 법률로 정한다.','ㅋㅌㅊㅍ',410,NULL,0),(188,'asdf','asdf','asdf',225,NULL,1),(189,'정당의 목적이나 활동','국무총리는 국무위원의 해임을 대통령에게 건의할 수 있다. 국가안전보장회의의 조직·직무범위 기타 필요한 사항은 법률로 정한다. 대법원장은 국회의 동의를 얻어 대통령이 임명한다.','asdf',308,NULL,0),(190,'정부는 회계연도마다','국정의 중요한 사항에 관한 대통령의 자문에 응하기 위하여 국가원로로 구성되는 국가원로자문회의를 둘 수 있다. 대통령의 임기연장 또는 중임변경을 위한 헌법개정은 그 헌법개정 제안 당시의 대통령에 대하여는 효력이 없다.','asdf',236,NULL,2),(191,'대법원과 각급법원의','국가는 평생교육을 진흥하여야 한다. 국회의원은 국가이익을 우선하여 양심에 따라 직무를 행한다. 국무회의는 정부의 권한에 속하는 중요한 정책을 심의한다.','asdf',211,NULL,0),(193,'뇨호호2','냐하하하','member',103,NULL,0),(195,'이미지 테스트','업로드 테스트','admin',119,'362e305d-76fa-48b0-b590-e93d0d8bb5da_source_01.jpg',2),(200,'asdf','asdf','asdf',116,NULL,0),(201,'대법원에 대법관','대통령은 국가의 독립·영토의 보전·국가의 계속성과 헌법을 수호할 책무를 진다. 외국인은 국제법과 조약이 정하는 바에 의하여 그 지위가 보장된다. 모든 국민은 자기의 행위가 아닌 친족의 행위로 인하여 불이익한 처우를 받지 아니한다.','asdf',122,NULL,0),(202,'국회는 헌법 또는 법','국회의 회의는 공개한다. 다만, 출석의원 과반수의 찬성이 있거나 의장이 국가의 안전보장을 위하여 필요하다고 인정할 때에는 공개하지 아니할 수 있다.','asdf',134,NULL,0),(203,'환경권의 내용과 행사','군인·군무원·경찰공무원 기타 법률이 정하는 자가 전투·훈련등 직무집행과 관련하여 받은 손해에 대하여는 법률이 정하는 보상외에 국가 또는 공공단체에 공무원의 직무상 불법행위로 인한 배상은 청구할 수 없다.','asdf',133,NULL,0),(204,'이 헌법시행 당시','제3항의 승인을 얻지 못한 때에는 그 처분 또는 명령은 그때부터 효력을 상실한다. 이 경우 그 명령에 의하여 개정 또는 폐지되었던 법률은 그 명령이 승인을 얻지 못한 때부터 당연히 효력을 회복한다.','asdf',311,NULL,0),(205,'소스 2','// a: 배열 A\n// tree: 세그먼트 트리\n// node: 노드 번호\n// node에 저장되어 있는 합의 범위가 start - end','ㅂㅈㄷㄱ',412,NULL,1),(206,'start == end','인 경우는 리프 노드인 경우입니다. 리프 노드는 배열의 그 수를 저장해야 하기 때문에, tree[node] = a[start]가 됩니다.','ㅂㅈㄷㄱ',413,NULL,1),(207,'node의 왼쪽 자식','node*2','ㅂㅈㄷㄱ',414,'37250c92-51d5-4342-91d6-c953fa8d5a43_캡처.PNG',1),(208,'연산자 우선순위','참고하세요','ㅂㅈㄷㄱ',311,'dd51bee7-896d-4dcb-a5ca-ad54ba42e731_연산자 우선순위.PNG',0),(209,'행정각부의 설치','대한민국은 민주공화국이다. 국회의 정기회는 법률이 정하는 바에 의하여 매년 1회 집회되며, 국회의 임시회는 대통령 또는 국회재적의원 4분의 1 이상의 요구에 의하여 집회된다.','abc',313,NULL,0),(210,'파일 크기 테스트','???','member',314,'8372a087-b03c-49fb-bc2f-476db18b6912_source_05.jpg',0),(211,'2호선1','sEfbmRI','abc',205,NULL,0),(212,'2호선2','OrCMbEMn','abc',206,NULL,0),(213,'2호선3','ED','abc',207,NULL,0),(214,'2호선4','FQGKh','abc',208,NULL,0),(215,'2호선5','QLDnGLGa','abc',209,NULL,0),(216,'2호선6','QaspNIDu','abc',210,NULL,0),(217,'2호선7','lXM','abc',211,NULL,0),(218,'2호선8','gtQ','abc',212,NULL,0),(219,'2호선9','RSDAk','abc',213,NULL,0),(220,'2호선10','OnPbAAH','abc',214,NULL,0),(221,'2호선11','OFQBAzFV','abc',215,NULL,0),(222,'2호선12','qggp','abc',216,NULL,0),(223,'2호선13','i','abc',217,NULL,0),(224,'2호선14','BtQf','abc',218,NULL,0),(225,'2호선15','uvkwyTSU','abc',219,NULL,0),(226,'2호선16','zrfE','abc',220,NULL,0),(227,'2호선17','AFerBeIXh','abc',221,NULL,0),(228,'2호선18','rR','abc',222,NULL,0),(229,'2호선19','WVyWA','abc',223,NULL,0),(230,'2호선20','ioDadE','abc',224,NULL,0),(231,'2호선21','MAAICNqM','abc',225,NULL,0),(232,'2호선22','zHEUV','abc',226,NULL,0),(233,'2호선23','U','abc',227,NULL,0),(234,'2호선24','VZf','abc',228,NULL,0),(235,'2호선25','NcWIeIth','abc',229,NULL,0),(236,'2호선26','aUXmd','abc',230,NULL,0),(237,'2호선27','pVgvyD','abc',231,NULL,0),(238,'2호선28','T','abc',232,NULL,0),(239,'2호선29','Zsqi','abc',233,NULL,0),(240,'2호선30','PsqIwNY','abc',234,NULL,0),(241,'2호선31','iDs','abc',235,NULL,1),(242,'2호선32','M','abc',236,NULL,0),(243,'2호선33','mVMI','abc',237,NULL,0),(244,'2호선34','qhdZ